import{_ as e,c as r,o,a1 as t}from"./chunks/framework.9YHhhtCJ.js";const f=JSON.parse('{"title":"3D Printing at Swarthmore","description":"","frontmatter":{},"headers":[],"relativePath":"Resources/Makerspace/makerspace.md","filePath":"Resources/Makerspace/makerspace.md"}'),a={name:"Resources/Makerspace/makerspace.md"},s=t('<h1 id="_3d-printing-at-swarthmore" tabindex="-1">3D Printing at Swarthmore <a class="header-anchor" href="#_3d-printing-at-swarthmore" aria-label="Permalink to &quot;3D Printing at Swarthmore&quot;">​</a></h1><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>Swarthmore College offers 3D printing services to students, faculty, and staff through the <a href="https://www.swarthmore.edu/makerspace" target="_blank" rel="noreferrer">MakerSpace</a> located in the Whittier Hall. This document provides an overview of the 3D printing resources available, the process for printing, guidelines for use, and troubleshooting tips.</p><h2 id="equipment-available" tabindex="-1">Equipment Available <a class="header-anchor" href="#equipment-available" aria-label="Permalink to &quot;Equipment Available&quot;">​</a></h2><h4 id="_3d-printers" tabindex="-1">3D PRINTERS <a class="header-anchor" href="#_3d-printers" aria-label="Permalink to &quot;3D PRINTERS&quot;">​</a></h4><ul><li>Ultimaker 3—PLA Plastic</li><li>Ultimaker S5—PLA and Nylon</li><li>Uprint SE Plus—ABS plastic</li><li>Onyx Pro by MarkForged— Nylon infused with Carbon Fiber and Fiberglass internal structure</li><li>Prusa Mk4 - PLA Plastic</li></ul><h4 id="_3d-scanner" tabindex="-1">3D SCANNER <a class="header-anchor" href="#_3d-scanner" aria-label="Permalink to &quot;3D SCANNER&quot;">​</a></h4><p>Eincsan-Pro +</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For further information about working hours, check their <a href="https://www.swarthmore.edu/makerspace" target="_blank" rel="noreferrer">website</a>.</p></div><h2 id="software" tabindex="-1">Software <a class="header-anchor" href="#software" aria-label="Permalink to &quot;Software&quot;">​</a></h2><p>Recommended software for designing 3D models:</p><p>• <strong>Tinkercad</strong> (beginner-friendly)</p><p>• <strong>Fusion 360</strong> (advanced CAD software)</p><p>• <strong>Blender</strong> (free and open-source 3D creation suite)</p><p>• Slicing software for preparing models:</p><p>• <strong>Ultimaker Cura</strong> (compatible with most FDM printers)</p><p>• <strong>PrusaSlicer</strong> (specifically for Prusa printers)</p><p>• <strong>PreForm</strong> (for Formlabs printers)</p><h2 id="_3d-printing-process" tabindex="-1">3D Printing Process <a class="header-anchor" href="#_3d-printing-process" aria-label="Permalink to &quot;3D Printing Process&quot;">​</a></h2><p><strong>Designing Your Model</strong></p><ol><li><p><strong>Choose your design software</strong>: Depending on your skill level, choose software that fits your needs (e.g., Tinkercad for beginners, Fusion 360 for advanced users).</p></li><li><p><strong>Create or download a model</strong>: Design your model or download one from a repository like Thingiverse.</p></li><li><p><strong>Save/export your model</strong>: Export your design as an STL.</p></li></ol><hr><p><strong>Preparing Your Model</strong></p><ol><li><p><strong>Open your slicing software</strong>: Use Cura, PrusaSlicer, or PreForm.</p></li><li><p><strong>Import your model</strong>: Load your STL file into the slicer.</p></li><li><p><strong>Configure print settings</strong>: Choose the appropriate settings for your print, including layer height, infill density, and support structures.</p></li><li><p><strong>Generate G-code</strong>: Slice the model to generate the G-code file.</p></li></ol><hr><p><strong>Submitting your Print</strong></p><ol><li>Once the G-code is generated. Import it into a USB drive.</li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>USB drives for 3D printing can be found in Makerspace.</p></div><ol start="2"><li>Plug your USB into the printer of your choice.</li><li>Press the <strong>start</strong> button.</li></ol><h2 id="guidelines-for-use" tabindex="-1">Guidelines for Use <a class="header-anchor" href="#guidelines-for-use" aria-label="Permalink to &quot;Guidelines for Use&quot;">​</a></h2><p>• <strong>Print Size</strong>: Ensure your model fits within the build volume of the printer you are using.</p><p>• <strong>Material Usage</strong>: Be mindful of the filament and resin consumption.</p><p>• <strong>Clean Up</strong>: Clean the build plate and surrounding area after your print is complete.</p><p>• <strong>Time Management</strong>: Plan your print ahead of time, considering the estimated print duration.</p><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><p>• <strong>Print not sticking to the bed</strong>: Ensure the build plate is clean and leveled. Use a suitable adhesive if necessary.</p><p>• <strong>Layer shifting</strong>: Check for loose belts or mechanical obstructions.</p><p>• <strong>Filament jams</strong>: Follow the printer-specific instructions for clearing jams.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Reach out to Makerspace techs or the supervisor for help.</p></div><h2 id="support-and-resources" tabindex="-1">Support and Resources <a class="header-anchor" href="#support-and-resources" aria-label="Permalink to &quot;Support and Resources&quot;">​</a></h2><p>• <strong>MakerSpace Staff</strong>: Available during open hours for assistance.</p><p>• <strong>Online Resources</strong>:</p><p>• <a href="https://support.ultimaker.com" target="_blank" rel="noreferrer">Ultimaker Support</a></p><p>• <a href="https://help.prusa3d.com" target="_blank" rel="noreferrer">Prusa Knowledge Base</a></p><p>• <a href="https://support.formlabs.com" target="_blank" rel="noreferrer">Formlabs Support</a></p><p>• <strong>Workshops and Tutorials</strong>: Check the MakerSpace calendar for upcoming workshops.</p>',46),n=[s];function i(l,p,c,u,d,h){return o(),r("div",null,n)}const m=e(a,[["render",i]]);export{f as __pageData,m as default};
